import History from './containers/History/History'
import './App.css';

class App extends Component {


  state = {
    data: null
  }

  componetDidMount (){
    console.log('mounted');
  }

  render (){
    return (
      <div className="AppResult">
        <h1>Hi</h1>
      </div>
    )
  }


  render(){
    let routes = (
      <Switch>
        <Route exact path='/history' component={History}/>
        <Route exact path='/' component={Scan}/>
      </Switch>
    )
    return (
    <BrowserRouter>
      <div className="bkg">
        <div className="container">

          <Navigation />

          {routes}

        </div>
      </div>
    </BrowserRouter>
  )};
}

export default App;
